import React from 'react';
import Input from '../Input/Input';
import Textarea from '../textarea/Textarea';
import Button from '../Button/Button';
import './ContactForm.css'; // Import the CSS file here

const ContactForm = () => {
  return (
    <div className="contactWork">
      <form>
        <div className='contactWork'>
          <h1>Contact-us</h1>
          <label className='labelContactWork'>Full Name</label>
          <Input placeholder="Full Name" inputId="fullname" type="text" />
          <label className='labelContactWork'>Email</label>
          <Input placeholder="Email" inputId="email" type="email" />
          <label className='labelContactWork'>Description</label>
          <Textarea placeholder="Description" id="textarea" rows="4" cols="55" />
        </div>
        <div className="form-check d-flex justify-content-center mb-4">
          <input
            className="form-check-input me-2"
            type="checkbox"
            value=""
            id="form4Example4"
            defaultChecked
          />
          <label className="form-check-label" htmlFor="form4Example4">
            Send me a copy of this message
          </label>
          <Button name="Send" className="buttonWork" />
        </div>
      </form>
    </div>
  );
};

export default ContactForm;
